import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div>
      <nav className="bg-black p-4 text-white font-bold flex justify-between">
        <div className="header">Game Platform</div>
        <div>
          <Link to="/" className="mx-2">
            Home
          </Link>
          <Link to="/games" className="mx-2">
            Games
          </Link>
        </div>
      </nav>
      <div className="bg-yellow p-4" />
    </div>
  );
};

export default Header;
